import{_ as o,c as e,o as i,ag as c}from"./chunks/framework.BJQRJOxx.js";const h=JSON.parse('{"title":"MacBook 终端命令大全","description":"","frontmatter":{},"headers":[],"relativePath":"list/单片机/MacBook 终端命令大全.md","filePath":"list/单片机/MacBook 终端命令大全.md","lastUpdated":null}'),d={name:"list/单片机/MacBook 终端命令大全.md"};function a(r,l,t,s,n,u){return i(),e("div",null,l[0]||(l[0]=[c('<h1 id="macbook-终端命令大全" tabindex="-1">MacBook 终端命令大全 <a class="header-anchor" href="#macbook-终端命令大全" aria-label="Permalink to &quot;MacBook 终端命令大全&quot;">​</a></h1><p>MacBook 的终端(Terminal)是一个强大的工具，可以直接与 macOS 的 Unix 底层交互。以下是一些常用和实用的终端命令分类整理：</p><h2 id="基本命令" tabindex="-1">基本命令 <a class="header-anchor" href="#基本命令" aria-label="Permalink to &quot;基本命令&quot;">​</a></h2><ol><li><p><strong>文件和目录操作</strong></p><ul><li><code>ls</code> - 列出目录内容 <ul><li><code>ls -l</code> - 详细列表</li><li><code>ls -a</code> - 显示隐藏文件</li></ul></li><li><code>cd</code> - 更改目录 <ul><li><code>cd ~</code> - 返回家目录</li><li><code>cd ..</code> - 返回上级目录</li></ul></li><li><code>pwd</code> - 显示当前工作目录</li><li><code>mkdir</code> - 创建新目录</li><li><code>rmdir</code> - 删除空目录</li><li><code>rm</code> - 删除文件 <ul><li><code>rm -r</code> - 递归删除目录及内容</li></ul></li><li><code>cp</code> - 复制文件/目录</li><li><code>mv</code> - 移动/重命名文件</li><li><code>touch</code> - 创建新文件或更新文件时间戳</li></ul></li><li><p><strong>文件查看和编辑</strong></p><ul><li><code>cat</code> - 显示文件内容</li><li><code>less</code> / <code>more</code> - 分页查看文件</li><li><code>nano</code> - 简单文本编辑器</li><li><code>vim</code> / <code>vi</code> - 高级文本编辑器</li><li><code>open</code> - 用默认程序打开文件 <ul><li><code>open .</code> - 在Finder中打开当前目录</li></ul></li></ul></li></ol><h2 id="系统信息" tabindex="-1">系统信息 <a class="header-anchor" href="#系统信息" aria-label="Permalink to &quot;系统信息&quot;">​</a></h2><ol><li><p><strong>系统信息</strong></p><ul><li><code>uname -a</code> - 显示系统信息</li><li><code>system_profiler SPHardwareDataType</code> - 显示硬件信息</li><li><code>top</code> - 显示运行中的进程(类似活动监视器)</li><li><code>htop</code> - 更友好的进程查看器(需安装)</li><li><code>df -h</code> - 显示磁盘空间使用情况</li><li><code>du -sh *</code> - 显示当前目录各文件/文件夹大小</li><li><code>sw_vers</code> - 显示macOS版本信息</li></ul></li><li><p><strong>网络相关</strong></p><ul><li><code>ifconfig</code> - 显示网络接口信息</li><li><code>ping</code> - 测试网络连接</li><li><code>netstat</code> - 显示网络状态</li><li><code>dig</code> - DNS查询工具</li><li><code>nslookup</code> - 查询DNS记录</li><li><code>ssh</code> - 远程登录</li><li><code>scp</code> - 安全复制文件</li></ul></li></ol><h2 id="进程管理" tabindex="-1">进程管理 <a class="header-anchor" href="#进程管理" aria-label="Permalink to &quot;进程管理&quot;">​</a></h2><ol><li><strong>进程控制</strong><ul><li><code>ps</code> - 显示当前进程 <ul><li><code>ps aux</code> - 显示所有运行中的进程</li></ul></li><li><code>kill</code> - 终止进程 <ul><li><code>kill -9 [PID]</code> - 强制终止进程</li></ul></li><li><code>killall</code> - 通过名称终止进程</li><li><code>lsof</code> - 列出打开的文件和进程</li></ul></li></ol><h2 id="用户和权限" tabindex="-1">用户和权限 <a class="header-anchor" href="#用户和权限" aria-label="Permalink to &quot;用户和权限&quot;">​</a></h2><ol><li><p><strong>用户管理</strong></p><ul><li><code>whoami</code> - 显示当前用户名</li><li><code>id</code> - 显示用户身份信息</li><li><code>sudo</code> - 以超级用户权限执行命令</li><li><code>passwd</code> - 更改密码</li><li><code>dscl . -read /Users/[username]</code> - 查看用户信息</li></ul></li><li><p><strong>权限管理</strong></p><ul><li><code>chmod</code> - 更改文件权限</li><li><code>chown</code> - 更改文件所有者</li><li><code>chgrp</code> - 更改文件所属组</li></ul></li></ol><h2 id="实用工具" tabindex="-1">实用工具 <a class="header-anchor" href="#实用工具" aria-label="Permalink to &quot;实用工具&quot;">​</a></h2><ol><li><p><strong>搜索</strong></p><ul><li><code>find</code> - 查找文件 <ul><li><code>find . -name &quot;*.txt&quot;</code> - 查找当前目录下所有txt文件</li></ul></li><li><code>grep</code> - 文本搜索 <ul><li><code>grep &quot;text&quot; file.txt</code> - 在文件中搜索文本</li></ul></li><li><code>mdfind</code> - Spotlight搜索(快速) <ul><li><code>mdfind -name &quot;filename&quot;</code></li></ul></li></ul></li><li><p><strong>压缩和解压</strong></p><ul><li><code>tar -czvf archive.tar.gz folder</code> - 创建gzip压缩文件</li><li><code>tar -xzvf archive.tar.gz</code> - 解压gzip文件</li><li><code>zip -r archive.zip folder</code> - 创建zip压缩文件</li><li><code>unzip archive.zip</code> - 解压zip文件</li></ul></li><li><p><strong>其他实用命令</strong></p><ul><li><code>say</code> - 文本转语音</li><li><code>caffeinate</code> - 防止Mac进入睡眠</li><li><code>pbcopy</code> - 复制到剪贴板</li><li><code>pbpaste</code> - 从剪贴板粘贴</li><li><code>defaults</code> - 修改系统默认设置</li><li><code>brew</code> - Homebrew包管理器命令(需先安装)</li></ul></li></ol><h2 id="macos特有命令" tabindex="-1">macOS特有命令 <a class="header-anchor" href="#macos特有命令" aria-label="Permalink to &quot;macOS特有命令&quot;">​</a></h2><ol><li><p><strong>系统管理</strong></p><ul><li><code>softwareupdate</code> - 系统更新工具</li><li><code>spctl</code> - 管理Gatekeeper设置</li><li><code>csrutil</code> - 管理系统完整性保护(SIP)</li><li><code>nvram</code> - 查看/设置NVRAM变量</li><li><code>diskutil</code> - 磁盘工具</li><li><code>tmutil</code> - Time Machine工具</li></ul></li><li><p><strong>网络配置</strong></p><ul><li><code>networksetup</code> - 网络设置工具</li><li><code>airport</code> - Wi-Fi工具(通常位于/System/Library/PrivateFrameworks/Apple80211.framework/Versions/Current/Resources/airport)</li></ul></li></ol><h2 id="提示" tabindex="-1">提示 <a class="header-anchor" href="#提示" aria-label="Permalink to &quot;提示&quot;">​</a></h2><ol><li>使用<code>man [command]</code>查看任何命令的手册页(如<code>man ls</code>)</li><li>按Tab键可以自动补全命令和文件名</li><li>使用<code>history</code>查看命令历史记录</li><li>使用<code>!!</code>重复上一条命令</li><li>使用<code>[command] --help</code>查看命令帮助(许多命令支持)</li></ol><p>注意：使用终端命令时要小心，特别是使用<code>sudo</code>或删除命令时，错误的命令可能导致系统损坏或数据丢失。</p>',17)]))}const m=o(d,[["render",a]]);export{h as __pageData,m as default};
